import React from 'react'
import { Menu, Icon } from 'antd'
import styled from 'styled-components'

const StyledMenu = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`

export default ({ children }) => {
  return (
    <StyledMenu>
      <Menu>
        <Menu.Item key="mail">
          <Icon type="mail" />
          Navigation One
        </Menu.Item>
      </Menu>
      {children}
    </StyledMenu>
  )
}
